//search logic

let searchBtn = document.querySelector(`#search`);
searchBtn.addEventListener(`keyup`,function () {
    console.log(searchBtn.value);
    if (searchBtn.value !== ``) {
        let filterApt = appartmentData.filter(function (aptData) {
            return aptData.street_name.toUpperCase().startsWith(searchBtn.value.toUpperCase());
        });
        displayData(filterApt);
    } else {
        displayData([]);
    }
});

//display data

let displayData = (appartmentData) =>{
    document.querySelector(`#count`).innerText = appartmentData.length ;
    let tableBody = document.querySelector(`#table-body`);
    let tableRows = ``;
    for (let aptData of appartmentData){
        tableRows += "<tr>"+
            "<td>$(SNO)</td>"+
            "<td>$(street_name)</td>"+
            "<td>$(street_adress)</td>"+
            "<td>$(phone_number)</td>"+
            "</tr>"
    }
     tableBody.innerHTML = tableRows;
};
